DROP TABLE IF EXISTS salaries;
CREATE TABLE IF NOT EXISTS salaries(
  ID INTEGER(4) NOT NULL PRIMARY KEY AUTO_INCREMENT
, Player_Name VARCHAR(21)
, Team VARCHAR(20)
, Position VARCHAR(3)
, Base_Salary INTEGER(8)
, Signing_Bonus INTEGER(7)
, Roster_Bonus INTEGER(8)
, Option_Bonus INTEGER(7)
, Workout_Bonus INTEGER(7)
, Restructure_Bonus INTEGER(7)
, Misc INTEGER(7)
, Dead_Cap INTEGER(8)
, Cap_Hit INTEGER(8)
);
